import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const heading = {
  fontFamily: '"Bebas Neue", cursive',
  color: "#ffffffee",
  fontSize: "1000%",
  textAlign: "center",
  margin: "200px 0",
};

ReactDOM.render(
  <h1 style={heading}> Hello Sir, Good Morning</h1>,
  document.getElementById("root")
);
